message:
LSV, leia as regras do grupo:

🚫É proibido tratar de assuntos divergentes do tema central deste grupo;

🚫É proibido postar “brincadeiras” e “piadas” de conteúdo racista, LGBTfóbico, misógino e pornográfico;

🚫É proibido compartilhar qualquer tipo de corrente e anúncio de produtos e serviços;

🚫Palavras de baixo calão também estão proibidas no grupo;

‼️Preste atenção ao compartilhar links internos e verifique antes se eles são seguros e estão relacionados à proposta deste grupo;

‼️É vedado divulgar fake news no grupo, por isso, analise as informações que compartilhar e tenha certeza de que se trata de uma fonte fidedigna e confiável;

‼️Evite enviar áudios de longa duração (no máximo 2 minutos);

‼️Reporte ao administrador do grupo qualquer infração às regras estabelecidas para os membros;

❌O participante que violar as regras deste grupo está sujeito a advertências e até a expulsão, em casos mais graves.

👉🏻 Você aceita as regras?
